export const getFamilymoon: "\n  query GetFamilymoon($id: ID!) {\n    getFamilymoon(id: $id) {\n      id\n      destination\n      image\n      createdAt\n      updatedAt\n      __typename\n    }\n  }\n";
export const listFamilymoons: "\n  query ListFamilymoons(\n    $filter: ModelFamilymoonFilterInput\n    $limit: Int\n    $nextToken: String\n  ) {\n    listFamilymoons(filter: $filter, limit: $limit, nextToken: $nextToken) {\n      items {\n        id\n        destination\n        image\n        createdAt\n        updatedAt\n        __typename\n      }\n      nextToken\n      __typename\n    }\n  }\n";
